import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';
import { BrowserRouter, render } from 'react-router-dom';
const root = ReactDOM.createRoot(document.getElementById('root'));

render(
  <BrowserRouter>
    <App />
  </BrowserRouter>
